import React from "react";
import image1 from "../images/1.png";
import logo from "../logo.svg";

import "./App.css";

// function App() {
//   return (
//     <div className="App">
//       <header className="App-header">
//         <img src={logo} className="App-logo" alt="logo" />
//         <p>
//           Edit <code>src/App.js</code> and save to reload.
//         </p>
//         <a
//           className="App-link"
//           href="https://reactjs.org"
//           target="_blank"
//           rel="noopener noreferrer"
//         >
//           Learn React
//         </a>
//       </header>
//     </div>
//   );
// }

// export default App;

const App = () => {
  return (
    <div>
      <body>
        <header class="header">
          <div class="grid-container">
            <div class="grid-item content">
              <h1>
                👋 <br />
                Yen-Hung Lin (Jeff)
                <br />
                is a brand/visual designer
              </h1>
              <h2>
                Yen was born and raised in Taipei, Taiwan, and he graduated from
                the California College of the Arts with a BFA in Graphic Design.
                He has 5+ years of design experience, is currently based in SF
                Bay Area as a Visual designer at Engagio, and previously was a
                visual, brand, marketing, and UI designer at HTC and MOCACARE.
                With a graphic, visual, motion, UI, and industrial design
                background, he has experience working for marketing and product
                design departments in Healthcare, SaaS, and smartphone hardware
                companies located in different countries, including the USA and
                Taiwan.
              </h2>
            </div>
            <div class="grid-item image">
              <img src="../Images/2.png" />
            </div>
          </div>
        </header>

        {/* ------------------------------------------------------ */}
        <section class="section">
          <div class="grid-container">
            <div class="grid-item">
              <img src="/images/1.png" />
              <div class="info">
                <h4 class="project-name">Title of the work</h4>
                <h4 class="project-type">Product Design</h4>
              </div>
            </div>
            <div class="grid-item">
              <img src={image1} />
              <img src={logo} />
              <div class="info">
                <h4 class="project-name">Title of the work</h4>
                <h4 class="project-type">Product Design</h4>
              </div>
            </div>
            <div class="grid-item">
              <img src="../Images/1.png" />
              <div class="info">
                <h4 class="project-name">Title of the work</h4>
                <h4 class="project-type">Product Design</h4>
              </div>
            </div>
          </div>
          {/* <div class="button">
        <button>email</button>
        <button>resume</button>
      </div>  */}
        </section>

        {/* ------------------------------------------------------ */}
        <footer class="footer">
          <div class="grid-container">
            <div class="grid-item">
              <h1 class="title">More Works</h1>
              <div class="content-container">
                <img src="https://img.icons8.com/metro/26/000000/behance.png" />
                <img src="https://img.icons8.com/windows/32/000000/dribbble.png" />
                <img src="https://img.icons8.com/ios-filled/50/000000/medium-logo.png" />
              </div>
            </div>

            <div div class="grid-item">
              <h1 class="title">Social</h1>
              <div class="content-container">
                <img src="https://img.icons8.com/ios-filled/50/000000/pinterest.png" />
                <img src="https://img.icons8.com/material-outlined/24/000000/instagram-new.png" />
              </div>
            </div>

            <div div class="grid-item">
              <h1 class="title">Experience</h1>
              <div class="content-container">
                <h2 class="content">LinkedIn</h2>
                <h2 class="content">Resume</h2>
              </div>
            </div>

            <div class="grid-item">
              <h1 class="title">Contact</h1>
              <div class="content-container">
                <h2 class="content">hello@yenhunglin.com</h2>
              </div>
            </div>
          </div>
        </footer>

        <script src="" async defer></script>
      </body>
    </div>
  );
};

export default App;
